  true,\n\t\"url\": null,\n\t\"notes\": \"This data submission is a link to a thermodynamic
  database maintained by the University of Oregon. The data at this link are not 'data
  results' from sampling. The data at this link comprise a thermodynamic database
  for aqueous species, minerals, and gases, including data for stoichiometry, equilibrium
  constants log K(T,P), aqueous activity coefficients, fugacity coefficients, and
  water enthalpy. These data include REE aqueous species and minerals. These data
  are used by programs SOLVEQ-XPT, CHIM-XPT, and GEOCAL-XPT.n\",\n\t\"license_title\":
